import './App.css';
import  Intro  from './Intro';
import About from './pages/About';
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path='/' element={<Intro/>}/>
      </Routes>
    </>
  );
}

export default App;
